import React from 'react'
import { NavLink } from 'react-router-dom'
import { Menu } from 'antd';
import store from "../redux/store"
import { createFetchMenu } from "../redux/count_aciton"

export default function Side() {
    const onClick = (e) => {
        console.log('click ', e);
        store.dispatch(createFetchMenu({ type: 'FETCHMENU', data: e.key }))
    };
    return (
        <Menu
            onClick={onClick}
            style={{
                width: 256,
            }}
            mode="inline"
        >
            <Menu.Item key='jobManagemen'>
                <NavLink className='list-group-item' to='/jobManagemen'>作业管理</NavLink>
            </Menu.Item>
            <Menu.Item key='explorationProject'>
                <NavLink className='list-group-item' end to='/explorationProject'>勘探项目</NavLink>
            </Menu.Item>
        </Menu>
    )
}
